import React, { useState } from 'react';
import './sign.css'; // Import external CSS file

const SignIn = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [showRequiredMessage, setShowRequiredMessage] = useState(true);

  const handleSubmit = (event) => {
    event.preventDefault();
    if (!email || !password) {
      setShowRequiredMessage(true);
    } else {
      loggedIn();
    }
  };

  const loggedIn = () => {
    console.log("Logged in");
  };

  return (
    <div className="signin-container">
      <div className="signin-content">
        <h2 className="fw-bold mb-2 text-uppercase">Login</h2>
        <p className="text-white-50 mb-5">Please enter your login and password!</p>

        <form onSubmit={handleSubmit}>
          <div className="input-wrapper">
            <input
              className="input-field"
              type="email"
              placeholder="Email address"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>
          <div className="input-wrapper">
            <input
              className="input-field"
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>

          <p className="small mb-3 pb-lg-2">
            <a className="text-white-50" href="#!">
              Forgot password?
            </a>
          </p>
          <p className="required-text">{showRequiredMessage && "Please fill in all fields."}</p>
          <button className="login-btn">Login</button>
        </form>

        <p className="mb-0">
          Don't have an account? <a href="#!" className="text-white-50 fw-bold">Sign Up</a>
        </p>
      </div>
    </div>
  );
}

export default SignIn;
